function isCollision(x, y, w, h, etapa)
{

   var colIni = Math.floor(x / 10);
   var rowIni = Math.floor(y / 10);
   var colFin = Math.floor((x + w) / 10);
   var rowFin = Math.floor((y + h) / 10);
   // alert('Fila:' + row + ',Columna:' + col);

   if (colIni == 34 && rowIni == 19)
   {
      var hola = 1;
   }
   if (rowFin == 65)
   {
      var chao = 1;
   }
   for (yAxis = rowIni; yAxis <= rowFin; yAxis ++ )
   {
      for (xAxis = colIni; xAxis <= colFin; xAxis ++ )
      {
         if ( etapa[yAxis][xAxis] == 2)
         {
            return true;
         }
      }
   }
   return false;
}




